import React from "react";
import ReactDOM from "react-dom";
import './index.css';
const fname  = "pgllluuu";
const lname = "sharma";

const img1 = "https://picsum.photos/250/300";
const img2 = "https://picsum.photos/200/250";
const img3 = "https://picsum.photos/240/330";
const links = 'https://www.thapatechnical.com';
ReactDOM.render(
    <div>
       <h1 className="heading">my name is {` ${fname} ${lname}`}</h1>

      <img src = {img1} alt="randomImages" />
      <div className="img_div">
      <img src = {img2} alt="randomImages" />
      <a href={links} target="_">
      <img src = {img3} alt="randomImages" />
      </a>
      </div>
    </div>,
    document.getElementById("root")
);
